import { Divider } from "@mui/material";
export default function Header({ headerName }){
    return (
        <>
        <div className="header mb-">{headerName}:</div>
        <Divider sx={{width:50}} className="mb-4 mx-auto bg-[#FFD700]"/>
        </>
    )
}
